Meanwhile on one of the display panels the jungle was displayed,
however this time it was a real time display as oppose to the recorded
ones that everyone had seen on the ARK.

Of course the thick canopy of trees was shown, one that was so thick
that even infrared and other image enhancers could not truly pierce
its shell. However what it did pick up was an energy distortion field
composed at least partially of Unicronian energies. It was this field
that seemed to be what was blocking communications and sensor probes.
The field was perhaps one hundred miles or so in diameter and appeared
to be centered in a section of exposed caves about 50 miles from one
edge of the jungle.

Interestingly the field was beginning to flicker as if it were
becoming unstable, although there was no obvious reason for it.

